import React from 'react';
import styles from './httpError.module.css';

const Error401 = ({ title, subTitle }) => {
		return (
			<div className={styles.container}>
				<div className={styles.content}>
					<svg width='312' height='200' viewBox='0 0 312 200' xmlns='http://www.w3.org/2000/svg'
					xmlnsXlink='http://www.w3.org/1999/xlink'>
					<g id='Symbols' fill='none' fillRule='evenodd'>
						<g id='Modal---Errores-401' transform='translate(-245 -75)'>
							<image id='6' x='245.062' y='75.377' width='311.266' height='199.234'
							xlinkHref='data:image/png;base64,'
							/>
						</g>
					</g>
					</svg>
					<h2 className={styles.title}>{title}</h2>
					<div className={styles.decoratorLine}/>
					<p  className={styles.text}>{subTitle }</p>
				</div>
			</div>
		);
	};

export {Error401};
